import React, { useState } from 'react';
import './App.css';
import AdminDashboard from './AdminDashboard';

function App() {
  const [profiles, setProfiles] = useState([
    {
      id: 1,
      name: 'MS Dhoni',
      photo: 'data:image/jpeg;base64,',
      address: 'Ranchi, Bihar',
    },
    {
      id: 2,
      name: 'Virat Kohli',
      photo: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQk8HpDrYnaODtnghczDBs0f4Nalq_chptAbA&usqp=CAU',
      address: 'New Delhi',
    },
    {
      id: 3,
      name: 'Rohit Sharma',
      photo: 'data:image/jpeg;base64,',
      address: 'Nagpur',
    },
    {
      id: 4,
      name: 'Suresh Raina',
      photo: 'data:image/jpeg;base64,',
      address: 'Muradnagar',
    },{
      id: 5,
      name: 'Jasprit Bumrah',
      photo: 'data:image/jpeg;base64,',
      address: 'Ahmedabad',
    },{
      id: 6,
      name: 'Ravindra Jadeja',
      photo: 'data:image/jpeg;base64,',
      address: 'Gujrat',
    },
    {
      id: 7,
      name: 'Rishabh Pant',
      photo: 'data:image/jpeg;base64,',
      address: 'Utrakhand',
    },
    {
      id: 7,
      name: 'KL Rahul',
      photo:'data:image/jpeg;base64,',
      address:'Bengaluru',
    },
    

  ]);
  const [selectedProfile, setSelectedProfile] = useState(null);
  const [showAdminDashboard, setShowAdminDashboard] = useState(false);

  const handleDelete = (id) => {
    const isConfirmDelete = window.confirm('Are you sure you want to delete this profile?');
    if (isConfirmDelete) {
      setProfiles(profiles.filter((profile) => profile.id !== id));
      if (selectedProfile && selectedProfile.id === id) {
        setSelectedProfile(null);
      }
    }
  };

  const handleShowSummary = (id) => {
    const selected = profiles.find((profile) => profile.id === id);
    setSelectedProfile(selected);
  };

  const handleAdminClick = () => {
    setShowAdminDashboard(true);
  };

  return (
    <div className="App">
      <header className="App-header">
      <h1 style={{ display: 'flex', justifyContent: 'space-between' }}>
  Profile Mapper
  <button
  onClick={handleAdminClick}
  style={{
    position: 'absolute',
    top: '10px', // Adjust this value to control the vertical position
    right: '10px', // Adjust this value to control the horizontal position
  }}
>
  Admin Dashboard
</button>
</h1>
      </header>
      <div className="profiles-container">
        {profiles.map((profile) => (
          <div className="profile-box" key={profile.id}>
            <img src={profile.photo} alt={profile.name} />
            <h2>{profile.name}</h2>
            <p>{profile.address}</p>
            <button onClick={() => handleDelete(profile.id)}>Delete</button>
            <button onClick={() => handleShowSummary(profile.id)}>Summary</button>
          </div>
        ))}
      </div>
      {showAdminDashboard ? (
        <AdminDashboard profiles={profiles} onDeleteProfile={handleDelete} />
      ) : (
        selectedProfile && (
          <div className="map-container">
            <iframe
              title="Address Map"
              width="100%"
              height="300"
              frameBorder="0"
              style={{ border: 0 }}
              src={`https://www.google.com/maps/embed/v1/place?q=${encodeURIComponent(
                selectedProfile.address
              )}&key=AIzaSyC2LiLkQ6Alf-eh4bTdniBpHiGoUIvdXtA`}
              allowFullScreen
            ></iframe>
          </div>
        )
      )}
    </div>
  );
}

export default App;
